import React from "react";
import "./ExpenseItem.css";

const ExpenseItem = () => {
  return (
    <React.Fragment>
      <div>March 28th 2021</div>
      <div>
        <h2>Car Insurance</h2>
        <div>$2.99 </div>
      </div>
    </React.Fragment>
  );
};

export default ExpenseItem;
